import React from 'react';
import ReactDOM from 'react-dom';
import { Alert } from '@coreui/react';
import 'bootstrap/dist/css/bootstrap.min.css'
import '@coreui/coreui/dist/css/coreui.min.css'

import './Carouseler.css';
import { Images } from './Images';

import collage from '../images/collage.jpeg';
const Carouseler = () => {
  return (
    <CCarousel controls>
    <CCarouselItem>
      <CImage className="d-block w-100" src={ReactImg} alt="slide 1" />
    </CCarouselItem>
    <CCarouselItem>
      <CImage className="d-block w-100" src={VueImg} alt="slide 2" />
    </CCarouselItem>
    <CCarouselItem>
      <CImage className="d-block w-100" src={AngularImg} alt="slide 3" />
    </CCarouselItem>
  </CCarousel>
  );
}
export default Carouseler;
